import React from 'react';
import { Icon } from 'react-icons-kit';
import {userPlus} from 'react-icons-kit/feather/userPlus'


const colorbtn = (props) => 
{ 
        return (
            <div className="col-md-2 mb-30"> 
              <button className={["btn w-100 btn-sm " + props.class]}><Icon icon={userPlus} size={20} />{props.colorname}</button>
           </div>
        ); 

}

export default colorbtn;
